.Moreover, with DVB-T tuner, you can turn the laptop on television.&nbsp;<br/><br/><br/><br/><strong>Specifications:</strong>&nbsp;<br/><br/><strong>Processor:</strong>&nbsp;<br/>Intel Core i7 2670QM 2.2 GHz with&nbsp;<br/>6 megabytes L3 Cache&nbsp;<br/>4 cores, 8 threads&nbsp;<br/>Intel Turbo Boost 2 with a frequency of 3.1 GHz&nbsp;<br/>Max TDP: 45 W&nbsp;<br/><br/><strong>Memory:&nbsp;<br/></strong>2x 4 GB DDR3 1333 MHz&nbsp;<br/>Up to 8 GB in two slots&nbsp;<br/><br/><strong>Display:&nbsp;<br/></strong>17.3 "TFT LCD with LED backlight TL&nbsp;<br/>Resolution: 1920 x 1080 pixels&nbsp;<br/><br/><strong>Graphic card:</strong>&nbsp;<br/>NVIDIA GeForce GT555M with3 gigabytes own memory&nbsp;<br/><br/><strong>Hard Drive:</strong>&nbsp;<br/>2x 500 GB&nbsp;<br/>7200 RPM&nbsp;<br/>Serial ATA&nbsp;<br/><br/><strong>Mechanics:</strong>&nbsp;<br/>DVD SuperMulti&nbsp;<br/><br/><strong>Multimedia:</strong>&nbsp;<br/>Audio codec&nbsp;<br/>Stereo speakers JBL second1 + MaxxAudio 3 (2x 4 W + 12 W subwoofer)&nbsp;<br/>Built-in microphone&nbsp;<br/>Webcam 2 Mpx&nbsp;<br/>DVB-T tuner&nbsp;<br/><br/><strong>Communication:&nbsp;<br/></strong>Ethernet LAN 10/100/1000 Mbit/s&nbsp;<br/>WiFi 802nd11b/g/n&nbsp;<br/><br/><strong>Interface:&nbsp;<br/></strong>2x USB 20&nbsp;<br/>2x USB third0&nbsp;<br/>1x HDMI 14&nbsp;<br/>1x Mini Display Port&nbsp;<br/>1x RJ-45&nbsp;<br/>1x Microphone&nbsp;<br/>1x Headphones&nbsp;<br/>1x Card Reader&nbsp;<br/>1x DC in&nbsp;<br/><br/><strong>Power:&nbsp;<br/></strong>Battery Li-Ion, 9 Cell&nbsp;<br/>150 W AC adapter&nbsp;<br/><br/><strong>Dimensions:&nbsp;<br/></strong>414.9 x 287.3 x 32.8 to 38.5 mm&nbsp;<br/><br/><strong>Weight:&nbsp;<br/></strong>3.53 kg (with battery)&nbsp;<br/><br/><strong>Operating System:&nbsp;<br/></strong>Microsoft Windows 7 Home Premium 64bit</div>', '2013-03-31 00:00:00', 5, 23490, , '2012-11-04 00:00:00', 100, 'Notebook Intel Core i7 2670M Sandy Bridge, 17.3" WLED 1920x1080, RAM 8GB DDR3, NVIDIA GeForce GT555M 3GB, HDD 2x500GB 7