FT LCDwith LED backlight&nbsp;<br/>Resolution 1366 x 768 pixels (16:9)&nbsp;<br/><br/><strong>Graphic card:</strong>&nbsp;<br/>AMD Radeon HD7670M with 1GB of its own memory&nbsp;<br/><br/><strong>Hard Drive:</strong>&nbsp;<br/>500 gigabytes&nbsp;<br/>5400 RPM&nbsp;<br/>Serial ATA&nbsp;<br/><br/><strong>Optical drive:</strong>&nbsp;<br/>DVD  RW SuperMulti 8x&nbsp;<br/><br/><strong>Multimedia:</strong>&nbsp;<br/>Sound Card&nbsp;<br/>Stereo speakers&nbsp;<br/>Microphone&nbsp;<br/>Web camera 1 megapixel (1280 x 720)&nbsp;<br/><br/><strong>Communication:</strong>&nbsp;<br/>Network card 10/100 Mbit/s&nbsp;<br/>WiFi 802nd11b/g/n&nbsp;<br/>BlueTooth&nbsp;<br/><br/><strong>Interface:</strong>&nbsp;<br/>1x HDMI v1.4&nbsp;<br/>1x VGA&nbsp;<br/>4x USB third0 (1x continuously powered)&nbsp;<br/>1x RJ-45&nbsp;<br/>1x Headphone and microphone&nbsp;<br/>1x Card Reader 8v1&nbsp;<br/>1x DC&nbsp;<br/><br/><strong>Power:</strong>&nbsp;<br/>Li-Ion battery 6-cell (48 Wh)&nbsp;<br/>65 W AC adapter&nbsp;<br/><br/><strong>Dimensions:</strong>&nbsp;<br/>345 x 252 x 30.03 to 34.1 mm&nbsp;<br/><br/><strong>Weight:</strong>&nbsp;<br/>from 2.74 kg&nbsp;<br/><br/><strong>Operating System:</strong>&nbsp;<br/>Microsoft Windows 7 Home Premium 64bit</div>', '2013-03-31 00:00:00', 7, 11990, , '2013-02-03 00:00:00', NULL, 'Notebook - Intel Core i3 2370M Sandy Bridge, 15.6" LED 1366x768, RAM 4GB, AMD Radeon HD7670M 1GB, HDD 500GB 5400 ot?ek, DVD, WiFi, BlueTooth, Webkamera, Windows 7 Home Premium 64bit', 'Dell Inspiron 5520 silver', 4, 2);
